using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using System.Windows;
using System.Windows.Controls;
using System.Windows.Data;
using System.Windows.Documents;
using System.Windows.Input;
using System.Windows.Media;
using System.Windows.Media.Imaging;
using System.Windows.Navigation;
using System.Windows.Shapes;
using System.IO;
using FileHelpers;
using System.Diagnostics;

namespace Launcher
{
    public partial class MainWindow : Window
    {
        List<string> display;
        List<string> paths;
        public MainWindow()
        {
            InitializeComponent();

            List<Exe> data = FileFinder.GetExes(FileFinder.GetPaths()[0]);
            display = data.Select(i => i.Display).ToList();
            paths = data.Select(i => i.Path).ToList();

            List.SelectionChanged += SelectChanged;
            List.ItemsSource = display;

            Banner.Source = Base64StringToBitmap("");
        }

        class FileFinder
        {
            private static string _dirData = "data.txt";
            public static List<Exe> GetExes(Project project) 
            {
                List<Exe> ret = new List<Exe>();
                    
                DirectoryInfo info = new DirectoryInfo(project.directory);
                if (!info.Exists)
                {
                    MessageBox.Show(String.Format("Složka {0} nenalezena!", project.directory), "Chyba!", MessageBoxButton.OK, MessageBoxImage.Error);
                    return ret;
                }
                foreach (FileInfo file in info.GetFiles("*.sln", SearchOption.AllDirectories))
                {
                    DirectoryInfo binDir = new DirectoryInfo(file.Directory.FullName + "\\" + System.IO.Path.GetFileNameWithoutExtension(file.Name) + "\\bin");
                    if (!binDir.Exists) continue;
                    foreach (FileInfo exe in binDir.GetFiles("*.exe", SearchOption.AllDirectories))
                    {
                        ret.Add(new Exe(String.Format("{0} - {1}", exe.Name, exe.Directory.Name), exe.FullName));
                    }
                }
                return ret;
            }
            public static List<Project> GetPaths()
            {
                FileHelperEngine<Project> engine = new FileHelperEngine<Project>();
                if (!File.Exists(_dirData)) File.Create(_dirData);
                return engine.ReadFileAsList(_dirData);
            }
        }

        private void Launch_Click(object sender, RoutedEventArgs e)
        {
            try
            {
                string x = (string)List.SelectedItems[0];
                Process.Start(paths[display.IndexOf(x)]);
            }
            catch { }
        }

        private void SelectChanged(object sender, RoutedEventArgs e)
        {

        }

        public static BitmapSource Base64StringToBitmap(string b64string)
        {
            var bytes = Convert.FromBase64String(b64string);

            using (var stream = new MemoryStream(bytes))
            {
                return BitmapFrame.Create(stream,
                    BitmapCreateOptions.None, BitmapCacheOption.OnLoad);
            }
        }
    }
}
